Outlook Email Address Extractor 2.2

Outlook Email Address Extractor is a handy tool to extract email addresses and 
names from your Outlook emails (mail folders). It retrieves all valid email 
addresses and automatically removes duplicates.

Outlook Email Extractor is compatible with Microsoft Outlook 2003, 2007, and 2010 
